import React from "react";
import { Card, CardContent, List, ListItem, ListItemText } from "@mui/material";

export const Categorylist = ({ name, setName, data, setData }) => {
  return (
    <Card>
      <CardContent>
        <h2>Category List</h2>
        <List>
          {data.map((item, index) => (
            <ListItem key={index}>
              <ListItemText primary={item} />
            </ListItem>
          ))}
        </List>
      </CardContent>
    </Card>
  );
};
